$(document).ready(function() {
/*---------------------------- start Slick_slider ------------------------*/
$('.program__slider').each(function() {
    $(this).slick({
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplay: false,
        infinite: true,
        autoplaySpeed: 5000,
        arrows: false,
        centerPadding: '0',
        dots: false,
        focusOnSelect: true,
        responsive: [{
                breakpoint: 1100,
                settings: {
                    slidesToShow: 3,
                }
            },
            {
                breakpoint: 825,
                settings: {
                    slidesToShow: 1,
                    centerMode: true,
                    centerPadding: '160px',
                }
            },
            {
                breakpoint: 725,
                settings: {
                    slidesToShow: 1,
                    centerMode: true,
                    centerPadding: '100px',
                }
            },
            {
                breakpoint: 565,
                settings: {
                    slidesToShow: 1,
                    centerMode: true,
                    centerPadding: '60px',
                }
            },
            {
                breakpoint: 465,
                settings: {
                    slidesToShow: 1,
                    centerMode: true,
                    centerPadding: '30px',
                }
            },
            {
                breakpoint: 410,
                settings: {
                    slidesToShow: 1,
                    centerMode: true,
                    centerPadding: '20px',
                }
            }
        ]
    });
});
$('.firstslider__slider').each(function() {
    $(this).slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        infinite: true,
        autoplaySpeed: 7000,
        arrows: false,
        dots: true,

        focusOnSelect: true,
    });
});


/*---------------------------- start Mask_input_telephone ------------------------*/

// $(".teclass").mask("+7(999) 999-99-99");
$('.teclass').mask('9 (999) 999-99-99').on('click', function() {
    if ($(this).val() === '_ (___) ___-__-__') {
        $(this).get(0).setSelectionRange(0, 0);
    }
});

});
/*---------------------------- start block ------------------------*/

$(document).ready(function() {
    $(".hamburger").click(function() {
        $(this).toggleClass('open');
        $(".headernew").slideToggle("slow");
        $('body').toggleClass('overflow');
        $('.haschild').removeClass('open');
    });
});
$(document).ready(function() {
    $(".haschild").click(function() {
        $('.haschild').removeClass('open');
        $(this).addClass('open');
    });
});

