; /* Start:"a:4:{s:4:"full";s:52:"/local/templates/academy/js/script.js?16230600403749";s:6:"source";s:37:"/local/templates/academy/js/script.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$( document ).ready(function() {

  //  
  $('.top-head__lang_item').click(function() {
    $('.top-head__lang_item').removeClass('top-head__lang_active');
    $(this).addClass('top-head__lang_active');
  })
//------------------

// 
  $('.ico-nav__item_search').click(function() {

    $('.bottom-head__search').toggle();
    console.log('asd');
  })

  $('.bottom-head__close').click(function() {
    $('.bottom-head__search').hide();
  })

//------------------


// Burger
  let burgerFlag = false;
  $('.burger').click(function() {
    burgerFlag = !burgerFlag;
    if (burgerFlag) {
      $('.burger').css('background', 'url(/local/templates/academy/img/burger-close.svg)center center no-repeat')
    } else {
      $('.burger').css('background', 'url(/local/templates/academy/img/burger.svg)center center no-repeat')
    }

  })
//------------------


// Select

  if ($('.select').length) {
    $(document).mouseup(function(e) { //    -
      let div = $(".new-select__list"); //   ID 
      if (!div.is(e.target) //       
          &&
          div.has(e.target).length === 0
          &&
          !($(e.target).prop('class').includes('on'))
      ) { //      
        div.slideUp(200); // 
        $('.new-select').removeClass('on');
      }
    });
  }

  $('.select').each(function() {
    const _this = $(this),
        selectOption = _this.find('option'),
        selectOptionLength = selectOption.length,
        selectedOption = selectOption.filter(':selected'),
        duration = 250; //  

    _this.hide();
    _this.wrap('<div class="select"></div>');
    $('<div>', {
      class: 'new-select',
      text: _this.children('option:disabled').text()
    }).insertAfter(_this);

    const selectHead = _this.next('.new-select');
    $('<div>', {
      class: 'new-select__list'
    }).insertAfter(selectHead);

    const selectList = selectHead.next('.new-select__list');
    for (let i = 1; i < selectOptionLength; i++) {
      $('<div>', {
        class: 'new-select__item',
        html: $('<span>', {
          text: selectOption.eq(i).text()
        })
      })
          .attr('data-value', selectOption.eq(i).val())
          .appendTo(selectList);
    }

    const selectItem = selectList.find('.new-select__item');
    selectList.slideUp(0);
    selectHead.on('click', function() {
      if (!$(this).hasClass('on')) {
        $(this).addClass('on');
        selectList.slideDown(duration);

        selectItem.on('click', function() {
          let chooseItem = $(this).data('value');

          $('select').val(chooseItem).attr('selected', 'selected');
          selectHead.text($(this).find('span').text());

          selectList.slideUp(duration);
          selectHead.removeClass('on');
        });

      } else {
        $(this).removeClass('on');
        selectList.slideUp(duration);
      }
    });
  });
//------------------

// Form validation


  $(".gp-form__text").change(function() {
    let redStar = $(this).siblings('.gp-form__label').children(".gp-form__required");
    if ($(this).val().length >= 3) {
      redStar.hide();
    } else {
      redStar.show();
    }
  });


  $(".gp-form__custom-checkbox").change(function() {
    let btnStatus = $(this).parent().siblings('.gp-form__btn-centered').children(".gp-form__btn");
    if ($(this).prop('checked')) {
      btnStatus.removeAttr('disabled');
      return
    }
    btnStatus.attr('disabled','disabled');
  });


//------------------
});

/* End */
;
; /* Start:"a:4:{s:4:"full";s:55:"/local/templates/academy/js/subscribe.js?16291890153874";s:6:"source";s:40:"/local/templates/academy/js/subscribe.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
$( document ).ready(function() {
/* Function for ours ajax inquiry  */
function ajaxpostshow(url, email){
    $.ajax({
        type: "POST",
        url: url,
        data: {email: email},
        success: function(data){
            $('.suc-form').removeClass('suc-view');
            $('.suc-form').addClass('suc-hide');
            $('.suc-suc').removeClass('suc-hide');
            $('.suc-suc').addClass('suc-view');
            console.log(data);
        }
    });
}

/* For subscribe */
$("#form-subcribe").submit(function(e){
    e.preventDefault();
    var url = '/ajax/subscribe.php';
    var email = $('input[name="email"]').val();
    console.log(email);
    ajaxpostshow(url, email);

});

    function ajaxevent(url, email, name, textarea, name_event, grecaptcharesponse){
        $.ajax({
            type: "POST",
            url: url,
            data: {email: email, name: name, textarea: textarea, name_event: name_event, grecaptcharesponse:grecaptcharesponse},
            success: function(data){
                $('.suc-form').removeClass('suc-view');
                $('.suc-form').addClass('suc-hide');
                $('.suc-suc').removeClass('suc-hide');
                $('.suc-suc').addClass('suc-view');
                console.log(data);
            }
        });
    }

    $("#form-event").submit(function(e){
        e.preventDefault();
        var url = '/ajax/event.php';
        var email = $('input[name="email"]').val();
        var name = $('input[name="name"]').val();
        var textarea = $('textarea[name="mess"]').val();
        var name_event = $('input[name="name_event"]').val();
        var grecaptcharesponse = $('input[name="g-recaptcha-response"]').val();
        console.log(email);
        ajaxevent(url, email, name, textarea, name_event, grecaptcharesponse);

    });

    function ajaxedu(url, email, name, textarea, course, grecaptcharesponse){
        $.ajax({
            type: "POST",
            url: url,
            data: {email: email, name: name, textarea: textarea, course: course, grecaptcharesponse:grecaptcharesponse},
            success: function(data){
                $('.suc-form').removeClass('suc-view');
                $('.suc-form').addClass('suc-hide');
                $('.suc-suc').removeClass('suc-hide');
                $('.suc-suc').addClass('suc-view');
                console.log(data);
            },
            error: function(data){
                console.log(data);
            }
        });
    }

    $("#form-edu").submit(function(e){
        e.preventDefault();
        var url = '/ajax/edu.php';
        var email = $('input[name="email"]').val();
        var name = $('input[name="name"]').val();
        var textarea = $('textarea[name="mess"]').val();
        var course = $('select[name="course"]').val();
        var grecaptcharesponse = $('input[name="g-recaptcha-response"]').val();
        ajaxedu(url, email, name, textarea, course, grecaptcharesponse);

    });

    $('.again').click(function(){
        console.log(1);
        $('.suc-form').addClass('suc-view');
        $('.suc-form').removeClass('suc-hide');
        $('.suc-suc').addClass('suc-hide');
        $('.suc-suc').removeClass('suc-view');
    });

    $('.click-en').click(function (){
        var host = window.location.hostname;
        var pathname = window.location.pathname;
        var newpath = host+'/en'+pathname;
        window.location.replace("https://"+newpath);
    });
    $('.click-ru').click(function (){
        var host = window.location.hostname;
        var pathname = window.location.pathname;
        var newpathname = pathname.substr(3);
        var newpath = host+newpathname;
        window.location.replace("https://"+newpath);
    });

//------------------
});
